import { PersonDto } from './dto/person.dto'

export class PersonAPI {
  public static async getAll(): Promise<PersonDto[]> {
    const resp = await fetch('http://localhost:4000/person', {
      method: 'GET',
    })

    return await resp.json()
  }
}
